import logo from './logo.svg';
import './App.css';
import Signup from "./SignUp";
import Main from "./main";
import { Route } from "react-router-dom";

function App() {
  return (
    <div>
        <Route path="/" component={Main} exact/>
        <Route path="/signup" component={Signup} />
    </div>
  );
}

export default App;
